 fill in all blanks to view solution\",\"answerIsCorrect\":\"&#039;:ans&#039; is correct\",\"answerIsWrong\":\"&#039;:ans&#039; is wrong\",\"answeredCorrectly\":\"Answered correctly\",\"answeredIncorrectly\":\"Answered incorrectly\",\"solutionLabel\":\"Correct answer:\",\"inputLabel\":\"Blank input @num of @total\",\"inputHasTipLabel\":\"Tip available\",\"tipLabel\":\"Tip\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"autoCheck\":false,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":false},\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"a11yCheckingModeHeader\":\"Checking mode\",\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"questions\":[\"<p>Dear Tamer,</p>\\n\\n<p>Thank you for being my friend! Thank you for being by my side *and* helping me whenever I'm in need. I am different *because* I have autism. I know I'm not like you nor like other kids, *but* I can do a lot of things. I can play basketball *and* soccer. I can also swim *and* run.</p>\\n\\n<p>You were the one who understood all that. You saw that I wasn't like you, *but* you loved me *and* enjoyed spending time with me. You were always very helpful *and* supportive. I remember many times when the kids would refuse to play with me, *but* you wouldn't let that happen. You would call me *and* ask me to join the game. You did that *because* you didn't want me to feel lonely.</p>\\n\\n<p>I don't want to lose you, *so* I will pray that our friendship will last forever.&nbsp;</p>\\n\\n<p>With love,</p>\\n\\n<p>Ahmad</p>\\n\"],\"submitAnswer\":\"Submit\"},\"metadata\":{\"title\":\"Thank you for Being my Friend!\",\"license\":\"U\",\"defaultLanguage\":\"en\",\"contentType\":\"Fill in the Blanks\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Thank you for Being my Friend!\"},\"subContentId\":\"5213085b-ec3f-49a4-8a74-6ea2a244987f\"}],\"disableBackwardsNavigation\":false,\"randomQuestions\":false,\"endGame\":{\"showResultPage\":true,\"showSolutionButton\":true,\"showRetryButton\":true,\"noResultMessage\":\"Finished\",\"message\":\"Your result:\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"solutionButtonText\":\"Show solution\",\"retryButtonText\":\"Retry\",\"finishButtonText\":\"Finish\",\"showAnimations\":false,\"skippable\":false,\"skipButtonText\":\"Skip video\",\"scoreBarLabel\":\"You got @finals out of @totals points\",\"submitButtonText\":\"Submit\"},\"texts\":{\"prevButton\":\"Previous question\",\"nextButton\":\"Next question\",\"finishButton\":\"Finish\",\"textualProgress\":\"Question: @current of @total questions\",\"jumpToQuestion\":\"Question %d of %total\",\"questionLabel\":\"Question\",\"readSpeakerProgress\":\"Question @current of @total\",\"unansweredText\":\"Unanswered\",\"answeredText\":\"Answered\",\"currentQuestionText\":\"Current question\",\"submitButton\":\"Submit\",\"navigationLabel\":\"Questions\"},\"override\":{\"checkButton\":true}},\"library\":\"H5P.QuestionSet 1.20\",\"metadata\":{\"contentType\":\"Question Set\",\"license\":\"U\",\"title\":\"Conjunctions in Use\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Conjunctions in Use\"},\"subContentId\":\"de6b6c39-8ee4-4e18-9827-895baa483349\"},\"useSeparator\":\"disabled\"}]}","library":"H5P.Column 1.16","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Focus on Grammar - Conjunctions","def
